import React from 'react';
import './NavBar.css';

const NavBar: React.FC = () => {
    const links = [
        'Home',
        'About',
        'Products'
    ]

    const renderLinks = () => {
        var renderedLinks = []

        for (let i = 0; i < links.length; i++)
            renderedLinks.push(
                <li>
                    { links[i] }
                </li>
            )

        return renderedLinks
    }

    return (
        <div className="NavBar">
            <h1>Lynette's Skin Studio</h1>
            <ul>
                { renderLinks() }
            </ul>
        </div>
    )
}

export default NavBar
